import React from "react";
import { Route, Switch } from "react-router";
import Home from "./Home";



const App=()=>{
  return(
  <>
  <Switch>
     <Route path="/" component={Home} />
     <Route />
  <Home />
  </Switch>
  </>
  );
};

export default App;
